import React, { Component } from "react";

class Search extends Component {
  render() {
    return (
      <input
        type="text"
        className="form-control mb-3 w-50"
        onChange={e => {
          this.props.keyword(e.target.value);
        }}
      />
    );
  }
}

export default Search;
